import './index.css';
import{ employee } from './data.js'

function Profile() {
  return (
    <div className="profile">
      <img id="y" src={employee.profileImg} alt='profileImg'/>
      <p>{employee.name}</p>
      <h3>Location</h3>
      <p>{employee.location}</p>
      <h3>Blood group</h3>
      <p>{employee.bloodGroup}</p>
      <h3>Age</h3>
      <p>{employee.age}</p>
    </div>
  );
}

export default Profile;
